// Remove the datatoken from the DataNFT
await dataNFT.removeDatatoken(datatoken)
```

In this example, we first initialize an instance of the Ocean object with the necessary parameters. Then, we get the instances of the DataNFT and datatoken using their respective addresses. Finally, we remove the datatoken from the DataNFT using the `removeDatatoken` method.

